import React, {useState} from 'react';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';
import './navbar.css'

class MyButton {
  constructor(name, href) {
    this.name = name
    this.href = href
  }
}

class Navbar extends React.Component {
  getNavbarButtons = () => {
    const buttons = [new MyButton('home', '/'),
      new MyButton('about', '#about'),
      new MyButton('projects', '#projects'),
      new MyButton('eductation', '#education'),
      new MyButton('contact', '#contact'),
      new MyButton('resume', '#resume')]

    return buttons.map((btn) => {
      return <Button href={btn.href} className="navbar-btn">{btn.name}</Button>
    })
  }

  render() {
    return (
      <>
        <nav className="navbar">
          <div className="navbar-container">
            {this.getNavbarButtons()}
          </div>
        </nav>
      </>
    );
  }
}

export default Navbar;
